import React from 'react'

function handleClick() {
	this.setState({
		foo: 'bar'
	});
	console.log('click');
}
class MyComponent extends React.Component {
 render() {
  return (
   <button onClick={handleClick}>
   	click me
   </button>
  );
 }
}

export default MyComponent;
